insert into mana_menu (contents_id,menu_id,name) values (367,36701,'あなたと運命の相手との出会い方');insert into mana_menu (contents_id,menu_id,name) values (368,36801,'気づいて！　あなたのすぐ近くにいる「運命の相手」');insert into mana_menu (contents_id,menu_id,name) values (369,36901,'あの人の本心……あなたのことをどう思っている？');insert into mana_menu (contents_id,menu_id,name) values (370,37001,'【この片想いの結末】いつ、どんな形で訪れる？');insert into mana_menu (contents_id,menu_id,name) values (371,37101,'片思いの行方◆成就の可能性');insert into mana_menu (contents_id,menu_id,name) values (372,37201,'あの人が好きになる異性の性格やしぐさとは？');insert into mana_menu (contents_id,menu_id,name) values (373,37301,'あなたと同じようにあの人も想いを残している可能性はある？');insert into mana_menu (contents_id,menu_id,name) values (374,37401,'別れがくる前に、あの人があなたに伝えられなかった本音');insert into mana_menu (contents_id,menu_id,name) values (375,37501,'次に訪れる運命の出会いは、いつ頃？');insert into mana_menu (contents_id,menu_id,name) values (376,37601,'【あなたの人生】恋愛？　仕事？　どっちを優先？');insert into mana_menu (contents_id,menu_id,name) values (377,37701,'あの人は苦しんでいます。あの人があなたに対して【抱える苦悩】');insert into mana_menu (contents_id,menu_id,name) values (378,37801,'周囲から見たあなたの長所とは？');insert into mana_menu (contents_id,menu_id,name) values (379,37901,'心して聞いて！　あの人はあなたのことが好き？');insert into mana_menu (contents_id,menu_id,name) values (380,38001,'あの人はあなたとどのような関係になりたいと思っている？');insert into mana_menu (contents_id,menu_id,name) values (381,38101,'結婚の縁がある、その人はいったいどんな人？');insert into mana_menu (contents_id,menu_id,name) values (382,38201,'その人との出会いは、いつ・どこで訪れる？');insert into mana_menu (contents_id,menu_id,name) values (383,38301,'二人が永遠の愛を誓う日、それはいつ？');insert into mana_menu (contents_id,menu_id,name) values (384,38401,'気づいてないだけ？　あなたの人柄と特徴');insert into mana_menu (contents_id,menu_id,name) values (385,38501,'まだ知らない、あなたが秘める「才能」');insert into mana_menu (contents_id,menu_id,name) values (386,38601,'あなたも気づかない～あの人の本当の姿と性格～');insert into mana_menu (contents_id,menu_id,name) values (387,38701,'あの人の心の奥底に広がる、あなたへの感情');insert into mana_menu (contents_id,menu_id,name) values (388,38801,'あの人の気持ち。あなたのことを思っている？');insert into mana_menu (contents_id,menu_id,name) values (389,38901,'あなたを選んでくれる日は訪れるでしょうか？');insert into mana_menu (contents_id,menu_id,name) values (390,39001,'あなたの周りの異性は、あなたのことをどう見ている？');insert into mana_menu (contents_id,menu_id,name) values (391,39101,'あなたが独身生活で得たものとは？');insert into mana_menu (contents_id,menu_id,name) values (392,39201,'今のあの人にとって特別で大切な存在とは？');insert into mana_menu (contents_id,menu_id,name) values (393,39301,'あの人との未来、幸せになれる可能性はある？');insert into mana_menu (contents_id,menu_id,name) values (394,39401,'あの人の本音「あなたのことをどう思っている？」');insert into mana_menu (contents_id,menu_id,name) values (395,39501,'【あの人と急接近のチャンス】そのきっかけとは？');insert into mana_menu (contents_id,menu_id,name) values (396,39601,'まだ開花していない…あなたが生まれもつ才能');insert into mana_menu (contents_id,menu_id,name) values (397,39701,'あなたの片想いに立ち塞がる大きな障害とは');insert into mana_menu (contents_id,menu_id,name) values (398,39801,'あなたの人生において、深い絆で結ばれている存在');insert into mana_menu (contents_id,menu_id,name) values (399,39901,'今のあなた…どんな運命の波に乗っている？');insert into mana_menu (contents_id,menu_id,name) values (400,40001,'出会い済？運命の相手とあなたの今の関係性');insert into mana_menu (contents_id,menu_id,name) values (401,40101,'心当たりがあるのでは？「想いを寄せるその人の職業や周囲からの評価」');insert into mana_menu (contents_id,menu_id,name) values (402,40201,'最終的にあなたが手にする人生での幸運とは？');insert into mana_menu (contents_id,menu_id,name) values (403,40301,'やり直したいと願うなら……今あなたがやるべきこと');insert into mana_menu (contents_id,menu_id,name) values (404,40401,'あなたの「人生設計図」この先、どんな生き方が待っている？');insert into mana_menu (contents_id,menu_id,name) values (405,40501,'絶対結ばれると思ってた。でもそれに至らなかった理由とは？');insert into mana_menu (contents_id,menu_id,name) values (406,40601,'今、あなたと最も相性が良いと言えるのは、周囲の人々の中にいます。');insert into mana_menu (contents_id,menu_id,name) values (407,40701,'はっきり言います！「ふたりが恋人になる可能性」');insert into mana_menu (contents_id,menu_id,name) values (408,40801,'あなたの運命の人はどんな性格？そして容姿は？');insert into mana_menu (contents_id,menu_id,name) values (409,40901,'運命の相手と育む愛〜出会いの瞬間');insert into mana_menu (contents_id,menu_id,name) values (410,41001,'結婚後の未来のあの人とあなた◆どんな家庭になる？');insert into mana_menu (contents_id,menu_id,name) values (411,41101,'あなたが持つ出会い運、どんな性格の人を引き寄せる？');insert into mana_menu (contents_id,menu_id,name) values (412,41201,'あなたを待ち受ける要注意人物とは');insert into mana_menu (contents_id,menu_id,name) values (413,41301,'運命の出会いのために。相手を引き寄せる、あなたに必要な変化とは');insert into mana_menu (contents_id,menu_id,name) values (414,41401,'実は、あの人が考えているあなたとの未来');insert into mana_menu (contents_id,menu_id,name) values (415,41501,'ここ注目！　その人の顔、そして目を引くチャームポイント');insert into mana_menu (contents_id,menu_id,name) values (416,41601,'ふたりは今後はどうなる？　プロポーズもチェック');insert into mana_menu (contents_id,menu_id,name) values (417,41701,'あなたに起こる試練とは「こんな出来事」');insert into mana_menu (contents_id,menu_id,name) values (418,41801,'訪れる幸福な出来事、「こんなこと」が起きますよ');insert into mana_menu (contents_id,menu_id,name) values (419,41901,'この片想い。苦しい理由がわかりますか？');insert into mana_menu (contents_id,menu_id,name) values (420,42001,'あの人の理想の結婚相手像はこんな人！');insert into mana_menu (contents_id,menu_id,name) values (421,42101,'あの人があなたを結婚相手として選ぶ可能性');insert into mana_menu (contents_id,menu_id,name) values (422,42201,'信じられますか？　あなたを幸せにする人はこんな人');insert into mana_menu (contents_id,menu_id,name) values (423,42301,'現在あの人が一番興味を惹かれていること');insert into mana_menu (contents_id,menu_id,name) values (424,42401,'あの人と思うように話せない……、でもこのまま想っていてもいい？');insert into mana_menu (contents_id,menu_id,name) values (425,42501,'あなたの才能を開花させる方法');insert into mana_menu (contents_id,menu_id,name) values (426,42601,'あの人があなたを結婚相手として選ぶ可能性');insert into mana_menu (contents_id,menu_id,name) values (427,42701,'もしかして、彼には他に好きな人がいるの？');insert into mana_menu (contents_id,menu_id,name) values (428,42801,'あなたの運命の伴侶～性格と周囲からの評価～');insert into mana_menu (contents_id,menu_id,name) values (429,42901,'自分から誘ってみたい！　気になるあの人の反応');insert into mana_menu (contents_id,menu_id,name) values (430,43001,'あの人の気持ち～恋人がほしいと思う瞬間とは？');insert into mana_menu (contents_id,menu_id,name) values (431,43101,'今、あなたを支えてくれる、“重要な人物”');insert into mana_menu (contents_id,menu_id,name) values (432,43201,'まずはしっかり分析！　あなたの恋愛傾向');insert into mana_menu (contents_id,menu_id,name) values (433,43301,'彼は今、あなたのことをどう思っている？');insert into mana_menu (contents_id,menu_id,name) values (434,43401,'近い将来、ふたりが結ばれる可能性は？');insert into mana_menu (contents_id,menu_id,name) values (435,43501,'あの人はあなたのことを、今どう思っている？　未練はある？');insert into mana_menu (contents_id,menu_id,name) values (436,43601,'もしあの人に誘われたら、あなたはどうするべき？');insert into mana_menu (contents_id,menu_id,name) values (437,43701,'あなたに恋人ができる可能性と確率を上げる方法');insert into mana_menu (contents_id,menu_id,name) values (438,43801,'【恋の真相】あの人は現在、特別な感情を抱いている相手がいる？');insert into mana_menu (contents_id,menu_id,name) values (439,43901,'あなたの運命の相手と出会うシチュエーション');insert into mana_menu (contents_id,menu_id,name) values (440,44001,'二人が再び恋人としてやり直すための、とっておきの秘訣');insert into mana_menu (contents_id,menu_id,name) values (441,44101,'今、フォーカスされるあなたの魅力はここ！　');insert into mana_menu (contents_id,menu_id,name) values (442,44201,'あなたを本当に幸せするぴったりのお相手とは？');insert into mana_menu (contents_id,menu_id,name) values (443,44301,'覚悟して聞いて！　あの人のあなたに対しての正直な気持ち');insert into mana_menu (contents_id,menu_id,name) values (444,44401,'それは本音？　建前？　あの人の本心がわからない……。');insert into mana_menu (contents_id,menu_id,name) values (445,44501,'あなたに絶対知られたくない！　あの人の隠し事');insert into mana_menu (contents_id,menu_id,name) values (446,44601,'「今恋人がいないのはなぜ？」出会いが恋に繋がらなかった、本当の原因');insert into mana_menu (contents_id,menu_id,name) values (447,44701,'運命の恋を逃さないために、気を付ける事');insert into mana_menu (contents_id,menu_id,name) values (448,44801,'独身でいたことに意味アリ！　あなたの魅力とアピール方法');insert into mana_menu (contents_id,menu_id,name) values (449,44901,'30日間の人生運～あなたが幸せを掴むために～');insert into mana_menu (contents_id,menu_id,name) values (450,45001,'これからのあなたをサポートし、力強く後押しするものとは？');insert into mana_menu (contents_id,menu_id,name) values (451,45101,'絶対結ばれたい！　年の差片想いの必勝法教えます');insert into mana_menu (contents_id,menu_id,name) values (452,45201,'ズバリ、いつ・どんな場所で次に訪れる恋は始まる？');insert into mana_menu (contents_id,menu_id,name) values (453,45301,'あなたの《才能》を徹底解明！〜あなたの個性を最大限に発揮する「天職」〜');insert into mana_menu (contents_id,menu_id,name) values (454,45401,'ドキドキ！　あなたの運命の相手はどんな人？');insert into mana_menu (contents_id,menu_id,name) values (455,45501,'なぜこんなにあの人に惹かれるのでしょう');insert into mana_menu (contents_id,menu_id,name) values (456,45601,'進展させたい？　現状維持？　あの人が思うふたりの関係');insert into mana_menu (contents_id,menu_id,name) values (457,45701,'現在、あなたが周囲から受けている【評価】');insert into mana_menu (contents_id,menu_id,name) values (458,45801,'もしかして、自分の存在が周りに影響を与えてる？');insert into mana_menu (contents_id,menu_id,name) values (459,45901,'未来の結婚相手と出会う時期から結婚までのストーリー');insert into mana_menu (contents_id,menu_id,name) values (460,46001,'あなたと運命の相手が育む恋愛');insert into mana_menu (contents_id,menu_id,name) values (461,46101,'今後30日以内にあなたに訪れる「良い出来事」');insert into mana_menu (contents_id,menu_id,name) values (462,46201,'あなたの想いは、ちゃんとあの人の心に届いている？');insert into mana_menu (contents_id,menu_id,name) values (463,46301,'これが真実！　6ヶ月であの人の恋人になれる可能性');insert into mana_menu (contents_id,menu_id,name) values (464,46401,'年下のあの人から、あなたはどう思われている？');insert into mana_menu (contents_id,menu_id,name) values (465,46501,'あなたの幸せを引き寄せる潜在能力');insert into mana_menu (contents_id,menu_id,name) values (466,46601,'この片想い、今が攻め時？ それともまだ待つべき？');insert into mana_menu (contents_id,menu_id,name) values (467,46701,'知りたい！　あの人はあなたのことをどう思ってる？');insert into mana_menu (contents_id,menu_id,name) values (468,46801,'好機到来?!　あなたの人生に起こる出来事');insert into mana_menu (contents_id,menu_id,name) values (469,46901,'教えて……あの人は何故あなたに本心を隠すの？');insert into mana_menu (contents_id,menu_id,name) values (470,47001,'現状に不満あり？　あなたの今の状況');insert into mana_menu (contents_id,menu_id,name) values (471,47101,'あなたには決して言えない秘密事');insert into mana_menu (contents_id,menu_id,name) values (472,47201,'再び二人が恋人に戻る可能性はどの程度ある？');insert into mana_menu (contents_id,menu_id,name) values (473,47301,'近々あなたに起こる出来事とその意味');insert into mana_menu (contents_id,menu_id,name) values (474,47401,'最終的に、二人は復縁することができる？');insert into mana_menu (contents_id,menu_id,name) values (475,47501,'復縁は諦めるべき？　それともまだ望みは残っている？');insert into mana_menu (contents_id,menu_id,name) values (476,47601,'これから結婚へ向けて、あなたがやるべきこと');insert into mana_menu (contents_id,menu_id,name) values (477,47701,'待つだけの恋はもう終わり。恋の成就に向けてあなたに必要なこと');insert into mana_menu (contents_id,menu_id,name) values (478,47801,'あなたは、どんな仕事で才能を発揮できる?!');insert into mana_menu (contents_id,menu_id,name) values (479,47901,'訪れる転機～あなたをどのように成長させる？～');insert into mana_menu (contents_id,menu_id,name) values (480,48001,'あなたの出会い運をMAXにするために');insert into mana_menu (contents_id,menu_id,name) values (481,48101,'あの人の現在の状況について');insert into mana_menu (contents_id,menu_id,name) values (482,48201,'あなたは気づいている？　仕事で発揮すべき隠れた才能');insert into mana_menu (contents_id,menu_id,name) values (483,48301,'この片想いを進展させるために、あなたがやるべきこと');insert into mana_menu (contents_id,menu_id,name) values (484,48401,'今現在のあなたの恋愛運について掘り下げます');insert into mana_menu (contents_id,menu_id,name) values (485,48501,'転機が起こり、その後変化するふたりの気持ち');insert into mana_menu (contents_id,menu_id,name) values (486,48601,'あなたに起こる、この3ヶ月以内での幸せな出来事');insert into mana_menu (contents_id,menu_id,name) values (487,48701,'あなたが気づかない、あの人の本質とは？');insert into mana_menu (contents_id,menu_id,name) values (488,48801,'この異性に、これから一ヶ月、大注目して！');insert into mana_menu (contents_id,menu_id,name) values (489,48901,'出会いのため、あなたが身につけるべきモノとは？');insert into mana_menu (contents_id,menu_id,name) values (490,49001,'あなたが今、最も輝く職場/仕事のアプローチ');insert into mana_menu (contents_id,menu_id,name) values (491,49101,'彼が望んでいる恋人との付き合い方');insert into mana_menu (contents_id,menu_id,name) values (492,49201,'あの人のあなたへの好意を「恋」に変える方法');insert into mana_menu (contents_id,menu_id,name) values (493,49301,'あなたは、あの人にとってどんな存在？');insert into mana_menu (contents_id,menu_id,name) values (494,49401,'あなたの運命の相手はこの人。きっと近くにいます!');insert into mana_menu (contents_id,menu_id,name) values (495,49501,'二人が復縁できる可能性はどのくらい？');insert into mana_menu (contents_id,menu_id,name) values (496,49601,'現在のあなたの結婚引き寄せの能力とは？');insert into mana_menu (contents_id,menu_id,name) values (497,49701,'嫉妬に襲われたときの、あなたの対処法');insert into mana_menu (contents_id,menu_id,name) values (498,49801,'周りから好感をもたれる、あなたのこんなところ');insert into mana_menu (contents_id,menu_id,name) values (499,49901,'あの人と再び恋人同士に戻れる可能性はある？');insert into mana_menu (contents_id,menu_id,name) values (500,50001,'この恋の重大な障害～あの人の心を占めるもの～');insert into mana_menu (contents_id,menu_id,name) values (501,50101,'運命の出会いのために、あなたが心掛けること');insert into mana_menu (contents_id,menu_id,name) values (502,50201,'このままあの人を想い続けて、2人の関係はどうなる？');insert into mana_menu (contents_id,menu_id,name) values (503,50301,'あなたのこと。あの人にはこう見えています');insert into mana_menu (contents_id,menu_id,name) values (504,50401,'あの人と、復活をするためには何をするべき？');insert into mana_menu (contents_id,menu_id,name) values (505,50501,'今のまま待ち続けて、あの人から連絡の可能性はある？');insert into mana_menu (contents_id,menu_id,name) values (506,50601,'あなたにピッタリな運命の相手はこんな人です！');insert into mana_menu (contents_id,menu_id,name) values (507,50701,'このまま仕事を続けていて、私は結婚して幸せになれる？');insert into mana_menu (contents_id,menu_id,name) values (508,50801,'あの人が今大切にしたいのは、あなた？　それとも配偶者？');